6*f0*f4*x[1]^2*x[3]*x[6] + 8*f0*f5*x[1]^2*x[3]*x[7] + 4*f0*f4*x[1]^2*x[4]^2 +
(-2*f0*f4 - 2*f1*f3)*x[1]^2*x[4]*x[5] + (-4*f0*f5 + 4*f1*f4)*x[1]^2*x[4]*x[6] -
2*f1*f5*x[1]^2*x[4]*x[7] - 2*f0*x[1]^2*x[4]*x[8] + 4*f0*f4*x[1]^2*x[5]^2 +
