  m63 := g0*g1*h1*h4 + g0*g2*h1*h3 + 4*g0*g3*h0*h3 - g0*g3*h1*h2 - g0*g4*h1^2
          - g1^2*h0*h4 - g1*g2*h0*h3 + g1*g3*h0*h2 + g1*g4*h0*h1;
